<?php declare(strict_types=1); /** * Copyright (c) Be Delightful , Distributed under the MIT software license */ namespace Delightful\SuperMagic\Interfaces\SuperAgent\DTO\Response; /** * TopiccopiedResponseDTO.*/ class DuplicateTopicResponseDTO { /** * TaskKey.*/ protected string $taskKey; /** * TaskStatus*/ protected string $status; /** *  new TopicID.*/ protected ?string $topicId; /** * StatusMessage.*/ protected string $message; /** * ConstructFunction.*/ public function __construct( string $taskKey, string $status, ?string $topicId = Null, string $message = '' ) { $this->taskKey = $taskKey; $this->status = $status; $this->topicId = $topicId; $this->message = $message; } /** * Convert toArray.*/ public function toArray(): array { return [ 'task_key' => $this->taskKey, 'status' => $this->status, 'topic_id' => $this->topicId, 'message' => $this->message, ]; } /** * getTaskKey.*/ public function getTaskKey(): string { return $this->taskKey; } /** * setTaskKey.*/ public function setTaskKey(string $taskKey): self { $this->taskKey = $taskKey; return $this; } /** * getTaskStatus*/ public function getStatus(): string { return $this->status; } /** * setTaskStatus*/ public function setStatus(string $status): self { $this->status = $status; return $this; } /** * get new TopicID.*/ public function getTopicId(): ?string { return $this->topicId; } /** * set new TopicID.*/ public function setTopicId(?string $topicId): self { $this->topicId = $topicId; return $this; } /** * getStatusMessage.*/ public function getMessage(): string { return $this->message; } /** * setStatusMessage.*/ public function setMessage(string $message): self { $this->message = $message; return $this; } } 